                "tooltip": "Floating-point Complex Multiply Accumulate.",
                "html": "<p>Floating-point Complex Multiply Accumulate.</p><p>This instruction operates on complex numbers that are represented in SIMD&amp;FP registers as pairs of elements, with the more significant element holding the imaginary part of the number and the less significant element holding the real part of the number. Each element holds a floating-point value. It performs the following computation on the corresponding complex number element pairs from the two source registers and the destination register:</p><p>The multiplication and addition operations are performed as a fused multiply-add, without any intermediate rounding.</p><p>This instruction can generate a floating-point exception. Depending on the settings in <xref linkend=\"AArch64.fpcr\">FPCR</xref>, the exception results in either a flag being set in <xref linkend=\"AArch64.fpsr\">FPSR</xref> or a synchronous exception being generated. For more information, see <xref linkend=\"BEIJDDAG\">Floating-point exception traps</xref>.</p><p>Depending on the settings in the <xref linkend=\"AArch64.cpacr_el1\">CPACR_EL1</xref>, <xref linkend=\"AArch64.cptr_el2\">CPTR_EL2</xref>, and <xref linkend=\"AArch64.cptr_el3\">CPTR_EL3</xref> registers, and the current Security state and Exception level, an attempt to execute the instruction might be trapped.</p>",
