                "html": "<p>Floating-point Square Root (scalar). This instruction calculates the square root of the value in the SIMD&amp;FP source register and writes the result to the SIMD&amp;FP destination register.</p><p>A floating-point exception can be generated by this instruction. Depending on the settings in <xref linkend=\"AArch64.fpcr\">FPCR</xref>, the exception results in either a flag being set in <xref linkend=\"AArch64.fpsr\">FPSR</xref>, or a synchronous exception being generated. For more information, see <xref linkend=\"BEIJDDAG\">Floating-point exception traps</xref>.</p><p>Depending on the settings in the <xref linkend=\"AArch64.cpacr_el1\">CPACR_EL1</xref>, <xref linkend=\"AArch64.cptr_el2\">CPTR_EL2</xref>, and <xref linkend=\"AArch64.cptr_el3\">CPTR_EL3</xref> registers, and the current Security state and Exception level, an attempt to execute the instruction might be trapped.</p>",
